import { Component } from "react";
import "./navbar.css";


class NavBar extends Component{
    render(){
        return(
            <nav>
                <div className="logo">
                    <h1 className="hed_1">Skill</h1>
                    <h1 className="hed_2">Adhyan</h1>
                </div>
                <div className="search">
                    <input></input>
                </div> 
            </nav>
        );
    }
}

export default NavBar;
